} contract OwnerUpOnlyTest is DSTest { CheatCodes cheats = CheatCodes(HEVM_ADDRESS); OwnerUpOnly upOnly; // setUp // testIncrementAsOwner function testFailIncrementAsNotOwner() public { cheats.prank(address(0)); upOnly.increment(); }
