} contract OwnerUpOnlyTest is DSTest { CheatCodes cheats = CheatCodes(HEVM_ADDRESS); OwnerUpOnly upOnly; // setUp // testIncrementAsOwner // Notice that we replaced `testFail` with `test` function testIncrementAsNotOwner() public { cheats.expectRevert( bytes("only the owner can increment the count") ); cheats.prank(address(0)); upOnly.increment(); }
