[FAIL. Counterexample: calldata=0x215a2f200000000000000000000000000000000000000001000000000000000000000000, args=[79228162514264337593543950336]] testWithdraw(uint256) (runs: 1, μ: 14993, ~: 14993) The default amount of ether that the test contract is given is 2**96 wei (as in DappTools), so let's make sure we do not send more than we have: contract SafeTest is DSTest { // safe // receive // setUp function testWithdraw(uint96 amount) public { // snip }
} And now it passes: $ forge test
