Running 1 test for SafeTest.json:SafeTest
[PASS] testWithdraw(uint96) (runs: 256, μ: 15086, ~: 15087) There are different ways to run property-based tests, notably parametric testing and fuzzing. Forge only supports fuzzing. When running a property-based test, the fuzzer will try to generate as many test cases as possible to uncover edge cases. You can configure the amount of scenarios the fuzzer will generate by setting FOUNDRY_FUZZ_RUNS .

