DSTest contains the following assertion functions: assertTrue(bool condition) Asserts the condition is true. bool success = contract.fun();
assertTrue(success); assertEq(<type> a, <type> b) Where <type> can be address, bytes32, int, uint Asserts a is equal to b. assertEq(1 ether, 1e18 wei); assertEqDecimal(<type> a, <type> b, uint decimals) Where <type> can be int, uint Asserts a is equal to b. assertEqDecimal(1 ether, 1e18 wei, 18); assertEq32(bytes32 a, bytes32 b) Asserts a is equal to b. assertEq(bytes32("abcd"), 0x6162636400000000000000000000000000000000000000000000000000000000); assertEq0(bytes a, bytes b) Asserts a is equal to b. string memory name1 = "Alice";
string memory name2 = "Bob";
assertEq0(bytes(name1), bytes(name2)); assertGt(<type> a, <type> b) Where <type> can be int, uint Asserts a is greater than or equal to b. assertGt(1 ether, 1e18 wei); assertGtDecimal(<type> a, <type> b, uint decimals) Where <type> can be int, uint Asserts a is greater than or equal to b. assertGtDecimal(1 ether, 1e18 wei, 18); assertGe(<type> a, <type> b) Where <type> can be int, uint Asserts a is greater than b. assertGe(2 ether, 1e18 wei); assertGeDecimal(<type> a, <type> b, uint decimals) Where <type> can be int, uint Asserts a is greater than b. assertGeDecimal(2 ether, 1e18 wei, 18); assertLt(<type> a, <type> b) Where <type> can be int, uint Asserts a is less than or equal to b. assertLt(1e18 wei, 1 ether); assertLtDecimal(<type> a, <type> b, uint decimals) Where <type> can be int, uint Asserts a is less than or equal to b. assertLtDecimal(1e18 wei, 1 ether, 18); assertLe(<type> a, <type> b) Where <type> can be int, uint Asserts a is less than b. assertLe(1e18 wei, 2 ether); assertLeDecimal(<type> a, <type> b, uint decimals) Where <type> can be int, uint Asserts a is less than b. assertLeDecimal(1e18 wei, 2 ether, 18); ℹ️ Information You can pass a custom error message to the above functions by providing an additional parameter string err.

