This section documents all cheat codes, gotchas, and provides usage examples. warp function warp(uint256) external; Sets block.timestamp. roll function roll(uint256) external; Sets block.number. fee function fee(uint256) external; Sets block.basefee. load function load(address account, bytes32 slot) external returns (bytes32); Loads the value from storage slot slot on account account. store function store(address account, bytes32 slot, bytes32 value) external; Stores the value value in storage slot slot on account account. sign function sign(uint256 privateKey, bytes32 digest) external returns (uint8 v, bytes32 r, bytes32 s); Signs a digest digest with private key privateKey, returning (v, r, s). This is useful for testing functions that take signed data and performs an ecrecover to verify the signer. addr function addr(uint256 privateKey) external returns (address); Computes the address for a given private key. ffi function ffi(string[] calldata) external returns (bytes memory); Calls an arbitrary command if ffi is enabled. It is generally advised to use this cheat code as a last resort, and to not enable it by default, as anyone who can change the tests of a project will be able to execute arbitrary commands on devices that run the tests. prank function prank(address) external; Sets msg.sender to the specified address for the next call . "The next call" includes static calls as well, but not calls to the cheat code address. Alternative Signature function prank(address sender, address origin) external; Sets msg.sender to sender and tx.origin to origin for the next call. startPrank function startPrank(address) external; Sets msg.sender for all subsequent calls until stopPrank is called. Alternative Signature function startPrank(address sender, address origin) external; Sets msg.sender to sender and tx.origin to origin for all subsequent calls until stopPrank is called. stopPrank function stopPrank() external; Resets msg.sender to FOUNDRY_SENDER . Always used in conjunction with startPrank . deal function deal(address who, uint256 newBalance) external; Sets the balance of an address who to newBalance. etch function etch(address who, bytes calldata code) external; Sets the bytecode of an address who to code. expectRevert function expectRevert(bytes calldata msg) external; If the next call does not revert with message msg, then expectRevert will. To use expectRevert with a string, convert it to bytes. cheats.expectRevert(bytes("error message")); To use expectRevert with a custom error type with parameters, ABI encode the error type. cheats.expectRevert( abi.encodeWithSelector(MyContract.CustomError.selector, 1, 2)
) Alternative Signature function expectRevert(bytes4) external; An alternative version of expectRevert that only takes an error type signature. Useful for custom error types that do not take parameters. cheats.expectRevert(MyContract.CustomError.selector) record function record() external; Tell the VM to start recording all storage reads and writes. To access the reads and writes, use accesses . accesses function accesses(address) external returns (bytes32[] memory reads, bytes32[] memory writes); Gets all storage slots that have been read (reads) or written to (writes) on an address. Note that record must be called first. expectEmit function expectEmit(bool checkTopic1, bool checkTopic2, bool checkTopic3, bool checkData) external; This cheat code is used to assert that certain logs are emitted on the next call. Call the cheat code, specifying whether we should check the first, second or third topic, and the log data. Emit the event we are supposed to see after the next call. Perform the call. For example: function testERC20EmitsTransfer() public { // Only `src` and `dst` are indexed in ERC20's `Transfer` event, // so we only check topic 0 and 1, as well as the data (`amount`). cheats.expectEmit(true, true, false, true); // We emit the event we expect to see. emit MyToken.Transfer(address(this), address(1), 10); // We perform the call. myToken.transfer(address(1), 10);
} mockCall function mockCall(address where, bytes calldata data, bytes calldata retdata) external; Mocks all calls to an address where if the call data either strictly or loosely matches data and returns retdata. When a call is made to where the call data is first checked to see if it matches in its entirety with data. If not, the call data is checked to see if there is a partial match, with the match starting at the first byte of the call data. If a match is found, then retdata is returned from the call. Mocked calls are in effect until clearMockedCalls is called. Note: Calls to mocked addresses may revert if there is no code on the address. This is because Solidity inserts an extcodesize check before some contract calls. To circumvent this, use the etch cheatcode if the mocked address has no code. Mocking an exact call function testMockCall() public { vm.mockCall( address(0), abi.encodeWithSelector(MyToken.balanceOf.selector, address(1)), abi.encode(10) ); assertEq(IERC20(address(0)).balanceOf(address(1)), 10);
} Mocking an entire function function testMockCall() public { vm.mockCall( address(0), abi.encodeWithSelector(MyToken.balanceOf.selector), abi.encode(10) ); assertEq(IERC20(address(0)).balanceOf(address(1)), 10); assertEq(IERC20(address(0)).balanceOf(address(2)), 10); // and so on..
} clearMockedCalls function clearMockedCalls() external; Clears all mocked calls. expectCall function expectCall(address where, bytes calldata data) external; Expects at least one call to address where where the call data either strictly or loosely matches data. When a call is made to where the call data is first checked to see if it matches in its entirety with data. If not, the call data is checked to see if there is a partial match, with the match starting at the first byte of the call data. If the test terminates without the call being made, the test fails. getCode function getCode(string calldata) external returns (bytes memory); Returns the bytecode for a contract in the project given the path to the contract.
